import React from "react";

const ModalThree = () => {
  return (
  <div>
    <div className="popup_informations">
      <div className="image">
        <img src="img/thumbs/4-3.jpg" alt="" />
        <div
          className="main"
          style={{
            backgroundImage: `url(${'https://user-images.githubusercontent.com/95555052/173667071-83e575ff-9bbf-4f03-a11a-ea8d711fb070.png'})`,
            height: "100%",
            width: "100%",
            overflow: "visible"
          }}
        ></div>
      </div>
      {/* End big image */}

      <div className="description">
        <h3>Project Strategy and Designing</h3>
        <p>
        Creation of wireframes is one of the first steps in the development of interfaces for websites and mobile applications and one of the most important stages, which affect the future of your digital product. 
        The importance of wireframing for a website or a mobile app should not be underestimated.
        </p>
      </div>
    </div>
    <div>
      
    </div>
    </div>
  );
};

export default ModalThree;
